window.bookSummaryJSON = "<p>Monsters didn't just exist in nightmares. They were real; they lived among us. As the sole witness to a brutal murder, Ryann Sinclair knew that better than anyone.</p> <p>He'd been burned once, and Cash Donovan swore it was the last time. That all changed when Ryann stumbled back into his life.</p> <p>She was fiercely protective of her heart, and he was hell-bent on protecting her. Never one to back down from a challenge, Cash was determined to break her. Just so he could be the one to put her back together.</p>"; 
